      <div className="d-flex justify-content-between">
        <div className="d-flex justify-content-around w-25">
          <span>
            <Link to="/">Home</Link>
          </span>
          <span>
            <Link to="/about">About</Link>
          </span>
          <span>
            <Link to="/contact">Contact</Link>
          </span>
        </div>
        <div>
          <span>
            <Link to="/register">Registration</Link>
          </span>
        </div>
      </div>
      <h1>home page</h1>
    </div>

